import React from "react"

import projectData from "../portfolio_data/projectData"
import Project from "./Project"

function MainContentPortfolio(){
    let i = 0;
    const myProjects = projectData.map(function(data){
        let img_pos;
        if(i % 2 == 0){
            img_pos = "l"
        }
        else{
            img_pos = "r"
        }
        i++;
        return <Project key={data.id} project={data} img_pos={img_pos}/>
    })

    return (
        myProjects
    )
}

export default MainContentPortfolio
